## Data Description - Abalone

- Dataset concerning .brand-red[**marine snails**], via Marine Research Laboratories, Taroona.



|Variable Name  |Variable Type |Description                              |
|:--------------|:-------------|:----------------------------------------|
|Sex            |Factor        |Adult, Female, or Infant (Unidentified)  |
|Length         |Continuous    |Longest shell measurement                |
|Diameter       |Continuous    |Perpendicular to length                  |
|Height         |Continuous    |With meat in shell                       |
|Whole Weight   |Continuous    |Grams	whole abalone                      |
|Shucked Weight |Continuous    |Grams	weight of meat                     |
|Viscera Weight |Continuous    |Grams	gut weight (after bleeding)        |
|Shell Weight   |Continuous    |Grams	after being dried                  |
|Rings          |Integer       |Number of Rings. +1.5 gives age in years |

.footnote[Table 1: Variables description of abalone dataset]
